__Dashboard__.css:
.dashboard {
    background: #fff;
}

/* title card */
.dashboard-markdown .dashboard-component-chart-holder{
    background: url('https://live.staticflickr.com/4846/45186088314_28882d9e91_b.jpg');
    background-size: cover;
    color: white;
}

.dashboard-markdown .dashboard-component-chart-holder h2{
    font-size: 4rem;
    text-shadow: 2px 2px 4px rgba(0,0,0,.7);
    font-weight: 100;
}
.dashboard-markdown .dashboard-component-chart-holder p{
    position: absolute;
    bottom: 0;
    left: 0;
    background: rgba(0,0,0,.7);
    width: 100%;
    margin: 0;
    padding: 10px;
}

/* stats cards */
.dragdroppable.dragdroppable-row:nth-of-type(n+1) .dragdroppable-column:nth-of-type(3) .dashboard-component-chart-holder{
    background: linear-gradient(#fff, rgba(0,0,200,.05));
    /*border: 1px solid rgb(0,0,100);*/
}
.dragdroppable.dragdroppable-row:nth-of-type(n+1) .dragdroppable-column:nth-of-type(3) .big_number_total{
    text-align: center;
    font-weight: 100;
    color: rgb(0,0,160);
}
.dragdroppable.dragdroppable-row:nth-of-type(n+1) .dragdroppable-column:nth-of-type(4) .dashboard-component-chart-holder{
    background: linear-gradient(#fff, rgba(400,0,0,.3));
    /*border: 1px solid rgb(100,0,0);*/
}
.dragdroppable.dragdroppable-row:nth-of-type(n+1) .dragdroppable-column:nth-of-type(4) .big_number_total{
    text-align: center;
    font-weight: 100;
    color: rgb(160,0,0);
}
.dragdroppable.dragdroppable-row:nth-of-type(n+1) .dragdroppable-column:nth-of-type(5) .dashboard-component-chart-holder{
    background: linear-gradient(#fff, rgba(0,400,0,.05));
    /*border:  1px solid rgb(0,100,0);*/
}
.dragdroppable.dragdroppable-row:nth-of-type(n+1) .dragdroppable-column:nth-of-type(5) .big_number_total{
    text-align: center;
    font-weight: 100;
    color: rgb(0,160,0);
}

